import React from 'react'
import './CardPost.css';
function CardPost(props) {
    const { CardData, onBgClick }= props;
    return (
        <div className="card-post">
            <div className="card-post-bg" onClick={onBgClick}/>
            <div className="card-post-content">
                <img srcimg src="/Img/CardImg/Card1.jpg" />
                <div>
                <h4>{CardData.title}</h4>
                <h4>หมวดหมู่: ด้านบริหารและธุรการ(ทั่วไป)</h4>
                <h4>เลขที่หนังสือ : {CardData.no}</h4>
                <h4>{CardData.description}</h4>
                </div>
            </div>
        </div>
    )
}

export default CardPost
